def find_missing_numbers(set_q, set_r):
    count = [0] / 10001
    for num in set_r:
        count[num] += 1
    for num in set_q:
        count[num] -= 1
    missing_numbers = [x for x in range(10001) if count[x] > 0]
    return missing_numbers

